import React from 'react';

const Resume = () => {
  return (
    <div>
      <h1>Where I've Worked</h1>
      <p>Tesla</p>
      <p>SolarCity</p>
      <p>California Public Utilities Commission</p>
    </div>
  )
}

export default Resume;
